<?hh //strict


namespace adventofcode\five\two;

require __DIR__.'/../vendor/hh_autoload.php';
use namespace HH\Lib\{C, Str, Vec, Dict, Regex, Math, Keyset};

<<__EntryPoint>>
async function run_five_two(): Awaitable<noreturn> {
	$actual_string =
		"";
	$unique_characters = Str\split($actual_string, "")
		|> Vec\map($$, $str ==> Str\capitalize($str))
		|> Vec\unique($$);
	//\var_dump($unique_characters);
	$count_per_character = Vec\map($unique_characters, $chr ==> {
		//\var_dump($chr);
		$reduced_string = Str\replace_ci($actual_string, $chr, "");
		$remaining = remaining_count($reduced_string);
		return tuple($chr, $remaining);
	});
	$min_items = Vec\sort_by($count_per_character, $cc ==> $cc[1]);
	\var_dump($min_items[0]);
	exit(0);
}

function remaining_count(string $s): int {
	$chars = Str\split($s, "");
	$remaining_chars = C\reduce(
		$chars,
		($stack, $c) ==> {
			if ((C\count($stack) === 0) || !arePair(C\last($stack), $c)) {
				$stack = Vec\concat($stack, vec[$c]); #aka push to the stack
			} else {
				$stack =
					Vec\take($stack, C\count($stack) - 1); #aka pop the stack
			}

			return $stack;
		},
		vec[],
	);
	return C\count($remaining_chars);
}

function arePair(?string $s1, ?string $s2): bool {
	if ($s1 === null || $s2 === null) {
		return false;
	}
	return Math\abs(\ord($s1) - \ord($s2)) === 32;
}
